import React from 'react';
// import PropTypes from 'prop-types'
// import { Link } from "react-router-dom";

export const Header = (props)=>{
    let mystyle = {
        width: '30px',
        height: '20px',
    }
    return(
        <img src="../public/etarkimg.png" style={mystyle} alt="logo" />
    )
}
